INSERT INTO `app_incentives_data_v2` (`id`, `state`, `kind_of_incentive`, `heading`, `text`, `end_date`, `product_type`, `last_updated_date`) VALUES
(1, 'All', 'Federal', 'Federal solar tax credit', 'The Solar Investment Tax Credit (ITC) is a green incentive designed to drive down the cost of installing panels on residential and commercial properties. Administered at the federal level, the ITC allows solar customers to claim a one-time tax credit upto 26% of the cost of installation – if they finance their solar photovoltaic (PV) systems with cash or loans.', '', 'Solar', '2/2/2021'),
(2, 'AZ', 'State', 'Residential Arizona solar energy tax credit', 'Arizona''s Solar Energy Credit is available to individual taxpayers who install a solar energy device. The credit is allowed against the taxpayer''s personal income tax in the amount of 25% of the cost of a solar energy device, with a $1,000 maximum allowable limit. The credit is claimed in the year of installation. Taxpayers who lease a system or enter into a power purchase agreement with a third party who owns the system are not eligible to receive the credit.', '', 'Solar', '2/2/2021'),
(3, 'AZ', 'State', 'Arizona solar energy sales tax exemption', 'Arizona provides a sales tax exemption for the retail sale of solar energy devices and for the installation of solar energy devices by contractors.', '', 'Solar', '2/2/2021'),
(4, 'AZ', 'State', 'Arizona solar energy property tax incentive', 'Arizona property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(5, 'CA', 'Local', 'California local solar rebates', 'Homeowners have access to rebate programs in many areas of the Golden State. These rebates can pay solar shoppers anywhere from $500 total to $0.95 per watt of installed capacity. Here''s one example:\n\nRancho Mirage Energy Authority: If you''re installing solar on a home in Rancho Mirage, the RMEA will provide a rebate of $500 to cover the cost of your permit fee. The rebate is given after the utility company has granted permission to operate (PTO).', '', 'Solar', '2/2/2021'),
(6, 'CA', 'State', 'Net metering in California', 'Net excess generation is credited to customer''s next bill at retail rate. After 12-month cycle, customer may opt to roll over credit indefinitely or to receive payment for credit at a rate equal to the 12-month average spot market price for the hours of 7 am to 5 pm for the year in which the surplus power was generated.', '', 'Solar', '2/2/2021'),
(7, 'CA', 'State', 'DAC-SASH', 'To increase access to solar for residents of disadvantaged communities (DACs) located within PG&E''s, SCE''s, or SDG&E''s service territory, DAC-SASH for single family solar homes (SASH) was launched. This program enables income-qualified homeowners in DACs to receive no-cost rooftop solar installations.', '', 'Solar', '2/2/2021'),
(8, 'CA', 'State', 'PACE solar financing', 'Under PACE programs, municipalities and counties form special tax districts to help property owners finance energy retrofits by allowing a property owner to place an additional tax assessment on his or her property. Property owners who invest in energy efficiency (EE) measures and small renewable energy (RE) systems repay these assessments over 15 to 20 years via additional annual payments on their property tax bills.', '', 'Solar', '2/2/2021'),
(9, 'CA', 'State', 'Self Generation Incentive Program (SGIP)', 'If you are a residential homeowner in California, you may qualify for additional incentives for your energy storage system through the SGIP Program. Residential customers of utility companies San Diego Gas & Electric (SDG&E), Pacific Gas & Electric (PG&E), Southern California Edison (SCE) and Southern California Gas (SoCal Gas) are eligible for SGIP.\n\nThe SGIP incentive can go up to $1000/kWh and varies depending on your income, location, and system size. The incentive amount is calculated based on the energy capacity (kWh) of battery installed, the allotted budget for the year and the applicable incentive rate. For more information, click here. (link to blog: https://enphase.com/en-us/sgip-overview)', '', 'Storage', '2/2/2021'),
(10, 'CO', 'State', 'Colorado local solar rebates', 'Many Colorado utilities and local organizations offer cash rebates to homeowners who want to install solar on their property. These are just two examples, but more local incentives are available – be sure to explore the options available in your area:\n\nEnergySmart Colorado: Rebates of anywhere from $400 to $3,000 (depending on where you live) are available for solar installations on homes in Eagle Valley, Roaring Fork Valley, and Summit County.\nHoly Cross Energy: Holy Cross has a per-kilowatt (kW) rebate for its customers to reduce the cost of going solar. The incentive is $750 for the first 6 kW, and is stepped down for larger systems. Homeowners installing an average 6kW system can save $4,500 on their installation costs with this great rebate.', '', 'Solar', '2/2/2021'),
(11, 'CO', 'State', 'Colorado solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(12, 'CO', 'State', 'Colorado solar energy property tax incentive', 'Colorado property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(13, 'CO', 'State', 'Colorado community solar', 'Community solar, also referred to as a solar garden, is a form of distributed generation that involves a solar array with multiple subscribers who may purchase a portion of the power produced and receive a credit on their electric bill.', '', 'Solar', '2/2/2021'),
(14, 'CO', 'State', 'Net metering in Colorado', 'The policy of net metering allows for customers to receive a credit for every kilowatt-hour their solar panels produce at the same price residential customers are charged for electricity, up to 120% of their electricity demand for Investor Owned Utilities (e.g. Xcel Energy and Black Hills) or capped at 10 kilowatts for residential for municipal (e.g. Fort Collins) and cooperative utilities (e.g. electric cooperatives who purchase wholesale power from Tri-State or other power providers).', '', 'Solar', '2/2/2021'),
(15, 'CT', 'State', 'Residential Solar Investement Program', 'The Residential Solar Investment Program (“RSIP”) is a Connecticut Green Bank program that makes it easy and affordable for homeowners to make the leap to a solar-powered home. It offers two types of incentives: The Expected Performance-Based Buydown (“EPBB”) and the Performance-Based Incentive (“PBI”).\nThe EPBB incentive provides an upfront cost reduction based on major design characteristics of the system. The incentive is paid directly to the Eligible Contractor on homeowner''s behalf when the system is complete.\nThe PBI is designed to allow homeowners to benefit from solar PV systems for little to no upfront cost. Under this model, an Eligible Third-Party PV System Owner owns the system and enters into a contract with the homeowner. The PBI is paid to the System Owner based on actual performance over the course of 6 years, and is used to reduce the homeowner’s monthly cost.', '', 'Solar', '2/2/2021'),
(16, 'CT', 'State', 'Energy Conservation Loan', 'On top of their solar rebate, the government of Connecticut may also provide you with a low interest loan for your system. Thanks to the Energy Conservation Loan, eligible families can borrow up to $25,000 for 10 years at low interest rates between 0 percent and 6 percent.', '', 'Solar', '2/2/2021'),
(17, 'CT', 'State', 'Connecticut solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(18, 'CT', 'State', 'Connecticut solar energy property tax incentive', 'Connecticut property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(19, 'CT', 'State', 'Net metering in Connecticut', 'The net metering rate for Connecticut solar system owners in Eversource territory are determined by multiplying the excess kilowatt-hour (kWh) fed into the grid by the standard electricity rate.', '', 'Solar', '2/2/2021'),
(20, 'DE', 'State', 'Net metering in Delaware', 'Credited to customer''s next bill at retail rate, except for certain community-owned facilities. After 12-month cycle, customer may opt to roll over credit indefinitely or to receive payment for credit at the energy supply rate.', '', 'Solar', '2/2/2021'),
(21, 'DE', 'State', 'Solar Renewable Energy Certificates (SRECs)', 'Delaware Renewable Portfolio Standard (RPS) requires the retail electricity suppliers to purchase 25% of the electricity sold in the state from renewable sources by 2025. The SREC program enables Delaware residents to sell the SRECs that their panels generate. As of early 2016, the going rate for these credits in DE was $25 per megawatt hour (MWh). At this rate, a 5 kilowatt (kW) system that generates 5 MWh per year could make an extra $2,500 over its life from selling credits in the SREC market. Utilities will purchase SRECs to meet Delaware’s Renewable Portfolio Standard (RPS) goal of sourcing 3.5 percent of its electricity needs from solar sources by 2025, and 25 percent from renewables more broadly.', '', 'Solar', '2/2/2021'),
(22, 'DE', 'Utility', 'Utility Solar Rebate Programs', 'While Delaware doesn’t offer a tax credit or rebate for going solar, many of the electric utilities in the state offer rebates to their customers, including:\n\nDelmarva Power and Light: Customers of Delmarva Power in Delaware are eligible for a cash rebate from the utility to reduce the cost of their solar installation. The utility will pay $0.55 per watt of solar generating capacity up to 5kW, and $0.20/W beyond 5kW. Rebate values will be reduced as more homeowners install solar.\nDelaware Electric Cooperative: Ratepayers receive $0.85/W of solar power installed (up to 5kW), and $0.25/W for any additional solar capacity.\nDelaware Municipal Electrical Corporation (DEMEC): The Municipal Green Energy Program pays customers of qualifying Delaware municipal utilities a cash rebate for a portion of their solar installation costs. The value of the rebate depends on where you live.', '', 'Solar', '2/2/2021'),
(23, 'FL', 'State', 'Net metering in Florida', 'Customer net excess generation (NEG) is carried forward at the utility''s retail rate (i.e., as a kilowatt-hour credit) to a customer''s next bill for up to 12 months. At the end of a 12-month billing period, the utility pays the customer for any remaining NEG at the utility''s avoided cost rate.', '', 'Solar', '2/2/2021'),
(24, 'FL', 'State', 'Florida solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(25, 'FL', 'State', 'Florida solar energy property tax incentive', 'Florida property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(26, 'GA', 'State', 'Net metering in Georgia', 'Systems connected on the customer''s side of the meter use a bi-directional meter, and any net excess generation (NEG) is credited to the customer''s next bill at a predetermined rate filed with the Georgia Public Service Commission (this is currently the Solar Avoided Cost for Georgia Power) . Alternatively, a customer may choose to sell all electricity from a system (rather than using the electricity generated by the system) by connecting ahead of the meter.', '', 'Solar', '2/2/2021'),
(27, 'IA', 'State', 'Net metering in Iowa', 'Net metering is available to customers of Iowa''s two investor-owned utilities, MidAmerican Energy and Interstate Power and Light (IPL). Although Iowa''s net-metering subrule requires utilities to purchase a customer’s net excess generation (NEG) at the utility''s avoided cost rate, subsequent rule waivers allow MidAmerican Energy and IPL customers to carry NEG forward for use in future months as a kilowatt-hour (kWh) credit. The net metering kWh offset effectively provides a credit at the customer''s retail electricity rate; however, MidAmerican and IPL customers cannot cash out any excess credits.', '', 'Solar', '2/2/2021'),
(28, 'IA', 'State', 'Iowa solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(29, 'IA', 'State', 'Iowa solar energy property tax incentive', 'Iowa property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems for the first 5 years.', '', 'Solar', '2/2/2021'),
(30, 'IA', 'State', 'Iowa residential solar tax credit', 'Under this credit, when you install a solar panel system at your home, you get 15% of the system cost back on your Iowa state income tax, with a $5,000 maximum credit amount.', '', 'Solar', '2/2/2021'),
(31, 'IL', 'State', 'Illinois'' SREC incentive: the Adjustable Block Program', 'Illinois Shines is the brand name for the Adjustable Block Program—a state-administered incentive program supporting the development of new solar energy generation in Illinois. For your new solar photovoltaic (“PV”) system to participate in Illinois Shines/Illinois Adjustable Block Program, you must work with an Approved Vendor who will apply to the Illinois Power Agency for that PV system to be part of the program. The program provides payments in exchange for 15 years of Renewable Energy Credits (“RECs”) from a utility contracted to buy the RECs from your Approved Vendor. These payments to your Approved Vendor will help offset the cost of your new PV system or your community solar subscription', '', 'Solar', '2/2/2021'),
(32, 'IL', 'State', 'Net metering in Illinois', 'Illinois net metering law requires investor owned utilities (ComEd, Ameren, MidAmerican) to offer one-to-one net metering for renewable energy generation that is sized to offset the household’s energy usage. Systems up to 2 megawatts (MW) in capacity that are intended primarily to offset the customer''s own electrical requirements are eligible for net metering. \n\nOne-to-one net metering means that you will be credited for the electricity you send back to the grid at the same rate that you are charged for electricity. This is the best type of net metering policy for consumers because it will lead to the highest level of savings.\n\nIn a given month, if you produce more electricity than you use, those excess net metering credits will rollover to the next month and can help offset future electricity usage. Any remaining credits will expire once per year, either in April or October, depending on which option you select.', '', 'Solar', '2/2/2021'),
(33, 'IL', 'State', 'Illinois solar energy property tax incentive', 'Illinois property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(34, 'IL', 'Utility', 'ComEd commercial solar rebates', 'ComEd, one of Illinois’s largest utility companies, provides rebates for commercial and industrial (C&I) customers to help decrease the out-of-pocket costs of installing solar. If you’re a ComEd customer and install solar on your business, you’re eligible for $250 per kilowatt (kW) of installed solar power. To receive the rebate, your solar panel system cannot be larger than 2,000 kW in capacity.', '', 'Solar', '2/2/2021'),
(35, 'IN', 'State', 'Net metering in Indiana', 'Facilities with a maximum capacity of 1 megawatt (MW) are eligible for net metering. Net excess generation (NEG) during a billing period is credited to the customer''s next monthly bill in the form of a kilowatt-hour (kWh) credit at the retail rate. NEG credits rollover indefinitely. If a customer elects to cease net metering, any unused credit will revert to the utility.', '', 'Solar', '2/2/2021'),
(36, 'IN', 'State', 'Indiana solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(37, 'IN', 'State', 'Indiana solar energy property tax incentive', 'Indiana property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(38, 'LA', 'State', 'Net metering in Louisiana', 'Residential solar PV systems under 25 kW are eligible for net-metering. Net excess generation will be credited to the customer''s next bill at retail rate and will be carried over indefinitely for customers who were interconnected before the utility reached its 0.5% of its retail peak load net metering cap. Systems that were interconnected after the utility reaches its jurisdictional net metering cap will still be allowed to interconnect but their net excess generation will be credited at the utility''s avoided cost rate.', '', 'Solar', '2/2/2021'),
(39, 'LA', 'State', 'Home Energy Loan Program (HELP)', 'A homeowner can obtain a five year loan to improve the energy efficiency of their existing home. HELP loans function as standard unsecured underwritten residential loans.  The lender makes and services HELP energy efficiency improvement loans of up to a maximum of $12,000.00 to participants who go through the normal underwriting process.  The LDNR loans one half  (½)  of the loan amount, through the lender to the borrower, for up to a maximum of $6,000.00 at 2% interest.  This blended rate provides a lower overall interest rate than what the borrower could obtain in the market as an incentive for implementing energy efficiency improvement measures.', '', 'Solar', '2/2/2021'),
(40, 'MA', 'State', 'Residential renewable energy income tax credit', 'Massachusetts allows a 15% credit -- up to $1,000 -- against the state income tax for the net expenditure* of a renewable energy system (including installation costs) installed on an individual’s primary residence. If the credit amount is greater than a resident''s income tax liability, the excess credit amount may be carried forward to the next succeeding year for up to three years.', '', 'Solar', '2/2/2021'),
(41, 'MA', 'State', 'Solar Massachusetts Renewable Target (SMART)', 'The Solar Massachusetts Renewable Target (SMART) Program is the DOER''s incentive program established to support the development of solar in Massachusetts. The tariff-based incentive is paid directly by the utility company to the system owner, following the approval of the application by the Solar Program Administrator and DOER.\n\nThe SMART Program is a 3,200 MW declining block incentive program. Eligible projects must be interconnected by one of three investor owned utility companies in Massachusetts: Eversource, National Grid, and Unitil.  For systems under 25 kilowatts (kW), the rate ranges from 29 to 31 cents per kWh, depending upon your location and utility.', '', 'Solar', '2/2/2021'),
(42, 'MA', 'State', 'Net metering in Massachusetts', 'In Massachusetts, the state''s investor-owned utilities are required to offer net metering. \nNEG is monetized and net metering credits are calculated based on the excess kilowatt-hours (kWh) produced. The value of the net metering credits at the end of a billing period is slightly less than the utility’s full retail rate.\n\nCredits may be carried forward to the next month indefinitely, and credits from net metering facilities may be transferred to another customer of the same utility as long as they are within the same service territory and ISO-NE load zone.', '', 'Solar', '2/2/2021'),
(43, 'MA', 'State', 'Mass Solar Loan program', 'The Massachusetts Department of Energy Resources (DOER) and the Massachusetts Clean Energy Center (MassCEC) have launched the Mass Solar Loan program for Massachusetts residents interested in directly owning their solar electric projects. While terms may vary, lenders will offer 10-year fixed-rate loans between $3,000 and $35,000. Lenders also have the discretion of offering loans up to $60,000. For Non-Income Qualified customers and Moderate Income customers, the maximum market interest rate from lenders is 6 percent. For Low Income customers eligible for the Interest Rate Buy Down, the maximum interest rate is 4.5%.', '', 'Solar', '2/2/2021'),
(44, 'MA', 'State', 'Massachusetts solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(45, 'MA', 'State', 'Massachusetts solar energy property tax incentive', 'Massachusetts property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(46, 'MD', 'State', 'Residential clean energy grant program', 'MEA offers the Residential Clean Energy Rebate Program ("R-CERP") to eligible Maryland homeowners. If you install a solar energy system, Maryland will pay you $1,000. Just make sure your system is smaller than 20 kilowatts (kW), is located at your primary residence, and that your installer has the standard NABCEP certification.', '', 'Solar', '2/2/2021'),
(47, 'MD', 'State', 'Solar Renewable Energy Certificates (SREC)', 'Under Maryland law, an SREC represents the generation attributes of 1 megawatt-hour (MWh) of electricity generation (or equivalent) from a qualifying solar facility. The traded value varies based on market conditions; as of March 2015 Maryland-sourced SRECs traded at average at $160/MWh ($0.16/kWh) as provided in SREC Trade.', '', 'Solar', '2/2/2021'),
(48, 'MD', 'State', 'Net metering in Maryland', 'Net excess generation (NEG) is generally carried over as a kilowatt-hour credit (i.e., at the retail rate) for 12 months. Compensation for any NEG remaining in a customer''s account after a 12-month period ending in April of each year is paid to the customer at the commodity energy supply rate.', '', 'Solar', '2/2/2021'),
(49, 'MD', 'State', 'Maryland solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(50, 'MD', 'State', 'Maryland solar energy property tax incentive', 'Maryland property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(51, 'ME', 'State', 'PACE loans', 'Property-Assessed Clean Energy (PACE) financing effectively allows property owners to borrow money to pay for energy improvements. The amount borrowed is typically repaid via a special assessment on the property over a period of years. In participating municipalities, homeowners can get PACE loans with a fixed interest rate of 4.99% and a term of up to 15 years, with the amount ranging from $6,500 to $15,000.', '', 'Solar', '2/2/2021'),
(52, 'ME', 'State', 'Community solar in Maine', 'Community solar, also referred to as a solar garden, is a form of distributed generation that involves a solar array with multiple subscribers who may purchase a portion of the power produced and receive a credit on their electric bill.', '', 'Solar', '2/2/2021'),
(53, 'ME', 'State', 'Net metering in Maine', 'All of Maine''s electric utilities -- investor-owned utilities (IOUs) and consumer-owned utilities (COUs), which include municipal utilities and electric cooperatives - offer participation in the buy-all, sell-all program for individual customers. If a customer''s nettable energy exceeds their kilowatt-hour (kWh) consumption during the billing period, excess nettable energy may be carried forward to the next billing period, for up to 12 months, at which time any remaining net excess generation is granted to the utility with no compensation for the customer.', '', 'Solar', '2/2/2021'),
(54, 'MI', 'State', 'Michigan Saves Home Energy Loan Program', 'Michigan Saves financing is financial capital made available to customers through a network of lenders that offer favorable terms based on a negotiated contract. Home upgrades are made with the help of authorized contractors through an authorized lending partner.\nHomeowners are eligible for rates ranging from 4.44% to 7.90% APR, though most customers finance at 5.50% APR. Terms are available up to 15 years with loan amounts ranging from $1,000 to $50,000. Actual rates, terms, and loan amounts vary and depend on the lender and your creditworthiness.', '', 'Solar', '2/2/2021'),
(55, 'MN', 'State', 'Minnesota solar energy sales tax exemption', 'Components used in the production of alternating current electricity from a renewable energy source, including solar, are exempt from sales and use tax.', '', 'Solar', '2/2/2021'),
(56, 'MN', 'State', 'Net metering in Minnesota', 'Each utility must compensate customers with systems less than 40 kW in size for net excess generation (NEG) at the "average retail utility energy rate," defined as "the total annual class revenue from sales of electricity minus the annual revenue resulting from fixed charges, divided by the annual class kilowatt-hour sales." Compensation may take the form of an actual payment (i.e., check for purchase) for NEG or as a credit on the customer''s bill.', '', 'Solar', '2/2/2021'),
(57, 'MN', 'Utility', 'Xcel Energy Program', 'Solar Rewards Income Qualified program provides incentives to customers with limited financial resources.Net Energy Metering (NEM) has the same benefits as Solar Rewards, except that it''s non-incentivized.The performance-based incentive (PBI) is offered for all Solar Rewards programs -- $0.07 per kWh produced by a residential PV system. It is paid annually for 10 years. The up-front incentives are available for income-qualified programs only and are calculated based on the proposed system size (DC).', '', 'Solar', '2/2/2021'),
(58, 'MN', 'Utility', 'SolarSense', 'Minnesota Power’s SolarSense program provides rebates to reduce the upfront costs of installing solar, helping make solar energy a more viable option for customers. SolarSense is available to customers installing a solar electric photovoltaic (PV) system.\n\nThe program funds are awarded to customers on a first-come, first-served basis. To calculate the SolarSense rebate, a PV system’s estimated energy output is multiplied by $0.56/kWh.', '', 'Solar', '2/2/2021'),
(59, 'MO', 'Utility', 'Columbia Water & Light solar rebate', 'Columbia Water & Light provides rebates based on the overall capacity of a solar system (kW) as well as its energy production (kWh) during “peak” times. The rebate tiers are additive. Therefore, the total rebate is calculated by adding all rebate tiers together. \n\nRebate tiers include:\n\n0 – 10 kW: $375 – $625 per kW\n10 – 50 kW: $300 – $500 per kW; and\n50 – 100 kW: $150 – $250 per kW.\nMore than 100 kW: No additional rebate offered.\n\nColumbia Water & Light also provides PV system loans up to $15,000 for residential customers and $30,000 for commercial customers.', '', 'Solar', '2/2/2021'),
(60, 'MO', 'Utility', 'Kansas City Power & Light solar rebate', 'Net metered solar households supplied by Kansas City Power & Light can receive a rebate payment of up to $1 per watt of solar power installed on their home. The payment rates of this rebate program vary based on your application date, so make sure to check with the utility to confirm your eligibility.', '', 'Solar', '2/2/2021'),
(61, 'MO', 'Utility', 'Empire District Electric solar rebate', 'Empire District Electric customers are eligible for a major solar rebate. Depending on the solar installation date and rebate application date, customers in the utility’s territory can receive a solar rebate of up to $2/W.', '', 'Solar', '2/2/2021'),
(62, 'MO', 'Utility', 'Amaren Missouri''s Solar PV Rebate Program', 'Are you an Amaren customer? If so, you’re eligible for a rebate from your utility when you install a solar panel system.\n\nRebates values vary based on the size of your system and the type of installation: customers can receive $0.25/watt upfront for installing solar panels – for an average 8 kilowatt(kW) system, that comes out to an extra $2,000 in savings.\n\nThe incentive is capped at 25 kW for residential customers, and 150 kW for commercial or industrial customers.', '', 'Solar', '2/2/2021'),
(63, 'MO', 'State', 'Missouri solar energy property tax incentive', 'Missouri property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(64, 'NC', 'State', 'North Carolina solar energy property tax incentive', 'North Carolina property tax incentive allows for 100% offset of property tax for the increased value of your property due to the installation of solar energy systems.', '', 'Solar', '2/2/2021'),
(65, 'NC', 'Utility', 'Duke Energy solar panel rebates', 'Duke Energy offers rebates to North Carolina customers who want to install a solar panel system. For homeowners, the program offers a $0.60/Watt rebate for systems up to 10 kilowatts. An average 6 kilowatt (kW) system would be eligible for a rebate of $3,600. There are also rebates available for nonresidential customers, worth $0.50/Watt up to $50,000, and for nonprofit customers, worth $0.75/Watt up to $75,000.', '', 'Solar', '2/2/2021'),
(66, 'NC', 'State', 'Revolving loan options', 'North Carolina authorizes cities and counties to establish revolving loan programs to finance renewable energy and energy efficiency projects that are permanently affixed to residential, commercial or other real property. A revolving loan program generally refers to a loan fund, where the loan repayments and interest are fed back into the fund. In this way, the loan can, in theory, continue indefinitely. HB 1389 allows cities and counties to fund their loan programs through Energy Efficiency and Conservation Block Grants from the federal government and the city''s or county''s unrestricted revenue. By law, the resulting loan programs may not charge more than 8% interest, and loan terms are limited to 20 years.', '', 'Solar', '2/2/2021'),
(67, 'NC', 'Local', 'Building permit rebates', 'The City of Asheville offers a $50 rebate for building permits and plan reviews for solar-energy systems. Regular fees must be paid in full but will be rebated upon certification. These rebates also apply to mixed-use commercial buildings if they include residential space.', '', 'Solar', '2/2/2021');
